import React from "react";
import Home from "../pages/Home";

function Header() {
    return (
        <header>
            <nav>
                <ul>
                    <li><NavLink to="/">{<Home/>}Home</NavLink>
                    </li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
            </nav>
        </header>
    );
  }
  
  export default Header;
